(X'39EEC1F00D8C4560BAF2A30C771BF148', X'AC2FB39A11DC4A7CB7831C5921A20E46', 1, 10.00, X'417786202CD94EB89655C67365551278', 90, 90.00, 'Write a Java program to read data from a file and count the number of occurrences of each word.', 'import java.io.BufferedReader;\nimport java.io.FileReader;\nimport java.io.IOException;\nimport java.util.HashMap;\nimport java.util.Map;\n\npublic class WordCounter {\n    public static void main(String[] args) {\n        Map<String, Integer> wordCount = new HashMap<>();\n        try (BufferedReader reader = new BufferedReader(new FileReader(\"input.txt\"))) {\n            String line;\n            while ((line = reader.readLine()) != null) {\n                String[] words = line.split(\"\\\\s+\");\n                for (String word : words) {\n                    wordCount.put(word, wordCount.getOrDefault(word, 0) + 1);\n                }\n            }\n        } catch (IOException e) {\n            System.out.println(\"Error reading file: \" + e.getMessage());\n        }\n        for (Map.Entry<String, Integer> entry : wordCount.entrySet()) {\n            System.out.println(entry.getKey() + \": \" + entry.getValue());\n        }\n    }\n}'),
(X'3A5C691FC19648708AAABD88A114113C', X'E990EEBA5D434251A2CED1C43C294048', 0, 10.00, X'1A1BBFFC6FEF44E1BBB98DC0726C2018', 120, 120.00, 'Write a recursive function in Java to generate all permutations of a given array of integers.', 'public void generatePermutations(int[] arr, int start, List<List<Integer>> result) {\n    if (start == arr.length) {\n        List<Integer> permutation = new ArrayList<>();\n        for (int num : arr) {\n            permutation.add(num);\n        }\n        result.add(permutation);\n        return;\n    }\n    for (int i = start; i < arr.length; i++) {\n        swap(arr, start, i);\n        generatePermutations(arr, start + 1, result);\n        swap(arr, start, i);\n    }\n}\n\nprivate void swap(int[] arr, int i, int j) {\n    int temp = arr[i];\n    arr[i] = arr[j];\n    arr[j] = temp;\n}'),
