(X'539A8B45D72748CCBD52D638FBD74EB9', X'AC2FB39A11DC4A7CB7831C5921A20E46', 1, 10.00, X'417786202CD94EB89655C67365551278', 70, 70.00, 'Write a Java program to merge the contents of two files into a third file.', 'import java.io.FileReader;\nimport java.io.FileWriter;\nimport java.io.BufferedReader;\nimport java.io.BufferedWriter;\nimport java.io.IOException;\n\npublic class FileMerger {\n    public static void main(String[] args) {\n        try (BufferedReader reader1 = new BufferedReader(new FileReader(\"input1.txt\"));\n             BufferedReader reader2 = new BufferedReader(new FileReader(\"input2.txt\"));\n             BufferedWriter writer = new BufferedWriter(new FileWriter(\"output.txt\"))) {\n            String line;\n            while ((line = reader1.readLine()) != null) {\n                writer.write(line);\n                writer.newLine();\n            }\n            while ((line = reader2.readLine()) != null) {\n                writer.write(line);\n                writer.newLine();\n            }\n            System.out.println(\"Files merged successfully.\");\n        } catch (IOException e) {\n            System.out.println(\"Error merging files: \" + e.getMessage());\n        }\n    }\n}'),
