(X'54A077F4F1764A7F8B4E2F3B0DD857EC', X'E990EEBA5D434251A2CED1C43C294048', 0, 10.00, X'1A1BBFFC6FEF44E1BBB98DC0726C2018', 120, 120.00, 'Write a recursive function in Java to generate all permutations of a given string.', 'public void permute(String s, int left, int right) {\n    if (left == right)\n        System.out.println(s);\n    else {\n        for (int i = left; i <= right; i++) {\n            s = swap(s, left, i);\n            permute(s, left + 1, right);\n            s = swap(s, left, i);\n        }\n    }\n}\n\nprivate String swap(String s, int i, int j) {\n    char[] charArray = s.toCharArray();\n    char temp = charArray[i];\n    charArray[i] = charArray[j];\n    charArray[j] = temp;\n    return String.valueOf(charArray);\n}'),
