(X'E04D634E5F2F473A9FDEFA6C032F6013', X'AC2FB39A11DC4A7CB7831C5921A20E46', 1, 10.00, X'417786202CD94EB89655C67365551278', 60, 60.00, 'Write a Java program to read a file and display its content in reverse order.', 'import java.io.FileReader;\nimport java.io.BufferedReader;\nimport java.io.IOException;\nimport java.util.Stack;\n\npublic class ReverseFileContent {\n    public static void main(String[] args) {\n        try (BufferedReader reader = new BufferedReader(new FileReader(\"input.txt\"))) {\n            Stack<String> lines = new Stack<>();\n            String line;\n            while ((line = reader.readLine()) != null) {\n                lines.push(line);\n            }\n            while (!lines.isEmpty()) {\n                System.out.println(lines.pop());\n            }\n        } catch (IOException e) {\n            System.out.println(\"Error reading file: \" + e.getMessage());\n        }\n    }\n}'),
