(X'E6C48E9C262C4FF18E27C20DE4E95290', X'E990EEBA5D434251A2CED1C43C294048', 1, 10.00, X'1A1BBFFC6FEF44E1BBB98DC0726C2018', 120, 120.00, 'Write a recursive function in Java to generate all permutations of a given array of integers.', 'public void generatePermutations(int[] arr, int index) {\n    if (index == arr.length - 1) {\n        System.out.println(Arrays.toString(arr));\n        return;\n    }\n    for (int i = index; i < arr.length; i++) {\n        swap(arr, index, i);\n        generatePermutations(arr, index + 1);\n        swap(arr, index, i);\n    }\n}\n\nprivate void swap(int[] arr, int i, int j) {\n    int temp = arr[i];\n    arr[i] = arr[j];\n    arr[j] = temp;\n}'),
